import './ExpenseItem.css';

function ExpenseItem() {
    return (
        <div className="expense-item">
            <div>
                <div>Month</div>
                <div>Year</div>
                <div>Day</div>
            </div>
            <h2 className="expense-item__description">title</h2>
            <div className="expense-item__price">price</div>
        </div>
    )
}

export default ExpenseItem;
